import filter_img_1 from '../img/components_img/filter_img/burger_img.png'
import filter_img_2 from '../img/components_img/filter_img/pizza_img.png'
import filter_img_3 from '../img/components_img/filter_img/sandwich_img.png'
import filter_img_4 from '../img/components_img/filter_img/asian_img.png'
import filter_img_5 from '../img/components_img/filter_img/set_menu_img.png'
import filter_img_6 from '../img/components_img/filter_img/burger_img_active.png'
import filter_img_7 from '../img/components_img/filter_img/pizza_img_active.png'
import filter_img_8 from '../img/components_img/filter_img/sandwich_img_active.png'
import filter_img_9 from '../img/components_img/filter_img/asing_img_active.png'
import filter_img_10 from '../img/components_img/filter_img/set_menu_img_active.png'

export const filter_img = [
    {
        img: filter_img_1,
    },
    {
        img: filter_img_2,
    },
    {
        img: filter_img_3,
    },
    {
        img: filter_img_4,
    },
    {
        img: filter_img_5,
    }
]

export const filter_img_active = [
    {
        img: filter_img_6,
    },
    {
        img: filter_img_7,
    },
    {
        img: filter_img_8,
    },
    {
        img: filter_img_9,
    },
    {
        img: filter_img_10,
    },
]
